import { TASK_STATUS } from "../types/todoTypes";

export const getStatus = (status:TASK_STATUS|number): {text: string; emoji: string} => {
    return status===TASK_STATUS.Open?{text: 'open', emoji: 'üî¥'}
    :status===TASK_STATUS.inProgress?{text: 'in Progress', emoji:'üü°'}: 
    status === TASK_STATUS.Done?{text: 'done', emoji: 'üü¢'}: {text: 'HZ', emoji: 'ü§∑‚Äç‚ôÇÔ∏è'}
}
